import { Carousel, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const cardData = [
    { title: 'Card 1', image: 'https://picsum.photos/200/300', description: 'Description for card 1' },
    { title: 'Card 2', image: 'https://picsum.photos/200/300', description: 'Description for card 2' },
    { title: 'Card 3', image: 'https://picsum.photos/200/300', description: 'Description for card 3' },
    { title: 'Card 4', image: 'https://picsum.photos/200/300', description: 'Description for card 4' },
    { title: 'Card 5', image: 'https://picsum.photos/200/300', description: 'Description for card 5' }
  ];
  
function cardcarousel(){
    return(
        <>
        <Carousel>
  {cardData.map((card, index) => (
    <Carousel.Item key={index}>
      <Card>
        <Card.Img variant="top" src={card.image} />
        <Card.Body>
          <Card.Title>{card.title}</Card.Title>
          <Card.Text>{card.description}</Card.Text>
        </Card.Body>
      </Card>
    </Carousel.Item>
  ))}
</Carousel>
        </>
    )
}


export default cardcarousel;
